import SHOP_DATA from "../../pages/Shop/Shop.data";

const INITAIL_STATE = {
  collections: SHOP_DATA,
};

export const shopReducer = (state = INITAIL_STATE, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
